import { makeStyles } from '@material-ui/core/styles';

export default makeStyles(() => ({
  appBar: {

    marginBottom: '10px',
    display: 'flex',
    flexDirection: 'row',
    justifyContent: 'center',
    alignItems: 'center',
  },

  image: {
    marginLeft: '15px',
  },
}));
